import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="bg-blue-500 text-white p-16">
        <h1 className="text-4xl mb-4">Path - The Self-Discovery Journal</h1>
        <p className="text-xl mb-8">Your personal companion on a journey towards self-understanding and growth.</p>
        <button className="bg-white text-blue-500 px-4 py-2 rounded">Get Started</button>
      </header>
      <section className="p-16">
        <h2 className="text-2xl mb-4">Discover your true self</h2>
        <p>Unlock your full potential with this beautifully designed journaling app. Created with deep psychological insights, Path combines the benefits of introspective journaling with AI technology.</p>
      </section>
      <section className="bg-blue-200 p-16">
        <h2 className="text-2xl mb-4">Our AI-powered prompts</h2>
        <p>Our AI-powered prompts will guide you, offering insightful questions designed to uncover your innermost thoughts, feelings, and aspirations.</p>
      </section>
      <section className="p-16">
        <h2 className="text-2xl mb-4">Privacy is our priority</h2>
        <p>Your entries are securely stored and are only accessible to you. With Path, your journey to self-discovery remains a personal and private experience.</p>
      </section>
    </div>
  );
}

export default App;
